INSERT INTO `textinfo` VALUES ('e06f2f1d-99df-11e0-9789-60eb69729418', '14583152', 'Hair 0');
INSERT INTO `textinfo` VALUES ('e06f349e-99df-11e0-9789-60eb69729418', '65597600', 'The Bladedancer is an offensive specialist who overcomes opponents with precision strikes and graceful agility. Their deadly dance is so fluid as to be mesmerizing, enabling a talented Bladedancer to easily avoid or deflect incoming attacks, while simultaneously launching lethal attacks of their own.');
INSERT INTO `textinfo` VALUES ('e06f35f6-99df-11e0-9789-60eb69729418', '70509246', 'Warden');
INSERT INTO `textinfo` VALUES ('e06f36b3-99df-11e0-9789-60eb69729418', '71279417', 'Void Knight');
INSERT INTO `textinfo` VALUES ('e06f3765-99df-11e0-9789-60eb69729418', '101953114', 'Hair 0');
INSERT INTO `textinfo` VALUES ('e06f3817-99df-11e0-9789-60eb69729418', '115990163', 'Ragged Breeches');
INSERT INTO `textinfo` VALUES ('e06f38ce-99df-11e0-9789-60eb69729418', '118804991', 'Coarse Cloth Vest');
INSERT INTO `textinfo` VALUES ('e06f397a-99df-11e0-9789-60eb69729418', '119927889', 'Archaic Knife');
INSERT INTO `textinfo` VALUES ('e06f3a26-99df-11e0-9789-60eb69729418', '132740308', 'Vagabond\'s Bow');
INSERT INTO `textinfo` VALUES ('e06f3ad7-99df-11e0-9789-60eb69729418', '148142932', 'Champion');
INSERT INTO `textinfo` VALUES ('e06f3b83-99df-11e0-9789-60eb69729418', '152306436', 'Hair 0');
INSERT INTO `textinfo` VALUES ('e06f3c34-99df-11e0-9789-60eb69729418', '165296123', 'Champion');
INSERT INTO `textinfo` VALUES ('e06f3ce0-99df-11e0-9789-60eb69729418', '179685030', 'Necromancer');
INSERT INTO `textinfo` VALUES ('e06f3d92-99df-11e0-9789-60eb69729418', '196862843', 'The Warden is a healer who calls upon the soothing power of water. They specialize in slow healing that escalates over time, making them ideal at aiding allies over prolonged fights that would leave most exhausted and unable to continue.');
INSERT INTO `textinfo` VALUES ('e06f3e7f-99df-11e0-9789-60eb69729418', '203435686', 'A veteran and survivor of many battlefields, the Warlord is a support specialist who has lived his life in conflict and understands it at an instinctual level. With powerful command auras, he controls the field of battle, emboldening allies and weakening opponents.');
INSERT INTO `textinfo` VALUES ('e06f41f7-99df-11e0-9789-60eb69729418', '211308037', 'Bronze Chain Leggings');
INSERT INTO `textinfo` VALUES ('e06f42ea-99df-11e0-9789-60eb69729418', '227930585', 'Timeworn Shield');
INSERT INTO `textinfo` VALUES ('e06f43cb-99df-11e0-9789-60eb69729418', '230478855', 'Warlord');
INSERT INTO `textinfo` VALUES ('e06f447c-99df-11e0-9789-60eb69729418', '253073325', 'Hair 0');
INSERT INTO `textinfo` VALUES ('e06f452e-99df-11e0-9789-60eb69729418', '259753024', 'Bare Torso');
INSERT INTO `textinfo` VALUES ('e06f45e0-99df-11e0-9789-60eb69729418', '269109944', 'Warlocks are offensive specialists who embrace the darker forces of entropy and death. From within a cloak of protective shadow, these mages direct deathly energies inexorably consuming their enemies\' lives, and feeding the Warlock on their stolen breath.');
INSERT INTO `textinfo` VALUES ('e06f4691-99df-11e0-9789-60eb69729418', '269344262', 'Beastmaster');
INSERT INTO `textinfo` VALUES ('e06f4743-99df-11e0-9789-60eb69729418', '277581398', 'Templars');
INSERT INTO `textinfo` VALUES ('e06f47ef-99df-11e0-9789-60eb69729418', '290412351', 'Mathosia');
INSERT INTO `textinfo` VALUES ('e06f489a-99df-11e0-9789-60eb69729418', '298135158', 'Hair 0');
INSERT INTO `textinfo` VALUES ('e06f4940-99df-11e0-9789-60eb69729418', '314369255', 'Hair 0');
INSERT INTO `textinfo` VALUES ('e06f49ec-99df-11e0-9789-60eb69729418', '315847035', 'Purifier');
INSERT INTO `textinfo` VALUES ('e06f4aa3-99df-11e0-9789-60eb69729418', '329998045', 'A Stormcaller is an offensive specialist who has learned to harness the power of the weather. They can devastate a large area by drawing on the power of wind and water, chilling their opponents with freezing rain or stopping their hearts with a bolt of lightning.');
INSERT INTO `textinfo` VALUES ('e06f4b4f-99df-11e0-9789-60eb69729418', '342863758', 'The Champion is an offensive powerhouse that specializes in the use of two-handed weapons. They wade into battle, quickly closing on the strongest opponent they can find with a single goal in mind: to seek glory by defeating all those who stand in their way.');
INSERT INTO `textinfo` VALUES ('e06f4c07-99df-11e0-9789-60eb69729418', '382983461', 'Dominators');
INSERT INTO `textinfo` VALUES ('e06f4cb8-99df-11e0-9789-60eb69729418', '390101603', 'Purifiers');
INSERT INTO `textinfo` VALUES ('e06f4d64-99df-11e0-9789-60eb69729418', '397928888', 'You\'ve joined with the Order of Mathos to fight the forces of Regulos. Gather your companions and push them back to the very walls of the Endless Citadel!');
INSERT INTO `textinfo` VALUES ('e06f571b-99df-11e0-9789-60eb69729418', '419138636', 'The Nightblade is an offensive rogue who mixes arcane powers with cold steel for deadly efficiency. Cloaked in shadow they rely on precise strikes of the blade and the cold fires of death to leave naught but ash in their wake.');
INSERT INTO `textinfo` VALUES ('e06f57de-99df-11e0-9789-60eb69729418', '450423169', 'Hair 0');
INSERT INTO `textinfo` VALUES ('e06f5884-99df-11e0-9789-60eb69729418', '457651603', 'Hair 0');
INSERT INTO `textinfo` VALUES ('e06f5977-99df-11e0-9789-60eb69729418', '461706769', 'Gained in PvP and Warfronts');
INSERT INTO `textinfo` VALUES ('e06f5a6a-99df-11e0-9789-60eb69729418', '462195945', 'Assassins are offensive rogues who have mastered the art of subtlety and subterfuge, they stalk the shadows bypassing obstacles to launch devastating surprise attacks. Those who survive the initial assault will rapidly find themselves falling prey to their virulent poisons.');
INSERT INTO `textinfo` VALUES ('e06f5b5c-99df-11e0-9789-60eb69729418', '485054010', 'Bare Hand');
INSERT INTO `textinfo` VALUES ('e06f5c43-99df-11e0-9789-60eb69729418', '525619342', 'Elementalists are offensive mages who specialize in manipulating and controlling the raw energies of the planes. Through fierce discipline and strict study, they have learned to master the primal forces of the elements and bind them into physical form to serve their will.');
INSERT INTO `textinfo` VALUES ('e06f5d36-99df-11e0-9789-60eb69729418', '542770108', 'Cabalist');
INSERT INTO `textinfo` VALUES ('e06f5de2-99df-11e0-9789-60eb69729418', '551532145', 'Hair 0');
INSERT INTO `textinfo` VALUES ('e06f5e88-99df-11e0-9789-60eb69729418', '555269707', 'Bladedancer');
INSERT INTO `textinfo` VALUES ('e06f5f33-99df-11e0-9789-60eb69729418', '565235393', 'Antiquated Staff');
INSERT INTO `textinfo` VALUES ('e06f5fd9-99df-11e0-9789-60eb69729418', '600925051', 'Player Head 0');
INSERT INTO `textinfo` VALUES ('e06f6085-99df-11e0-9789-60eb69729418', '606840014', 'Bare Leg');
INSERT INTO `textinfo` VALUES ('e06f6183-99df-11e0-9789-60eb69729418', '626305368', 'Rangers are flexible rogues with an uncanny way with the wild beasts of Telara. These masters of bow and blade develop a bond with their pets that lets them move as one in battle, each knowing what the other is thinking and reacting accordingly.');
INSERT INTO `textinfo` VALUES ('e06f6276-99df-11e0-9789-60eb69729418', '633549548', 'Reaver');
INSERT INTO `textinfo` VALUES ('e06f635d-99df-11e0-9789-60eb69729418', '641442182', 'Necromancer');
INSERT INTO `textinfo` VALUES ('e06f644a-99df-11e0-9789-60eb69729418', '655003695', 'Inquisitor');
INSERT INTO `textinfo` VALUES ('e06f64fc-99df-11e0-9789-60eb69729418', '660036705', 'Necromancers are offensive mages who have mastered the forbidden art of reanimating the dead and binding them to their will. Their twisted magics allow them to siphon off the vital essence of their opponents leaving them frail and unable to defend themselves from their undead minions.');
INSERT INTO `textinfo` VALUES ('e06f65a7-99df-11e0-9789-60eb69729418', '678091159', 'Archons are support specialists who have mastered the art of stealing an opponentâ€™s strength and converting that raw energy into beneficial magic. This allows them to bolster their allies, instantly turning the tide of battle when things seem bleakest.');
INSERT INTO `textinfo` VALUES ('e06f6d08-99df-11e0-9789-60eb69729418', '686215253', 'Favor');
INSERT INTO `textinfo` VALUES ('e06f6dc0-99df-11e0-9789-60eb69729418', '696681638', 'Hair 0');
INSERT INTO `textinfo` VALUES ('e06f6e5f-99df-11e0-9789-60eb69729418', '709920684', 'The Saboteur is an offensive based rogue who employs all manner of explosives and other incendiaries to cripple their opponents and control their battlefield. With proper preparation a Saboteur can destroy a group of opponents without ever engaging them directly.');
INSERT INTO `textinfo` VALUES ('e06f6f0b-99df-11e0-9789-60eb69729418', '711334177', 'Rugged Leather Slippers');
INSERT INTO `textinfo` VALUES ('e06f6fb7-99df-11e0-9789-60eb69729418', '715646252', 'Nightblade');
INSERT INTO `textinfo` VALUES ('e06f7063-99df-11e0-9789-60eb69729418', '720207767', 'Beastmaster');
INSERT INTO `textinfo` VALUES ('e06f7108-99df-11e0-9789-60eb69729418', '727900300', 'Reaver');
INSERT INTO `textinfo` VALUES ('e06f71b4-99df-11e0-9789-60eb69729418', '752754530', 'Rugged Leather Vest');
INSERT INTO `textinfo` VALUES ('e06f7260-99df-11e0-9789-60eb69729418', '764074369', 'Hair 0');
INSERT INTO `textinfo` VALUES ('e06f7306-99df-11e0-9789-60eb69729418', '767341538', 'Templar');
INSERT INTO `textinfo` VALUES ('e06f73b1-99df-11e0-9789-60eb69729418', '782531917', 'The goblins and House Aelfwar are fighting each other to the north. They must be stopped before their conflict destroys the forest.');
INSERT INTO `textinfo` VALUES ('e06f7469-99df-11e0-9789-60eb69729418', '787139622', 'Rusted Sabatons');
INSERT INTO `textinfo` VALUES ('e06f7515-99df-11e0-9789-60eb69729418', '794760366', 'Tarnished Breastplate');
INSERT INTO `textinfo` VALUES ('e06f75ba-99df-11e0-9789-60eb69729418', '805240809', 'The Dominator is a support specialist who excels at terrorizing their opponents leaving them unable or unwilling to act. Those who are capable of mustering the courage to assault a Dominator will find themselves at the mercy of arcane shields that return the fury of their blows tenfold.');
INSERT INTO `textinfo` VALUES ('e06f7666-99df-11e0-9789-60eb69729418', '807681650', 'The Void Knight is a defensive specialist who has trained in eldritch techniques to fight those who wield magic. Spells that would bring another warrior low are shaken off by a Void Knight, reflected back at the caster, or stored in magical pacts they can unleash with devastating effect.');
INSERT INTO `textinfo` VALUES ('e06f7dcd-99df-11e0-9789-60eb69729418', '825129314', 'Antiquated Sword');
INSERT INTO `textinfo` VALUES ('e06f7e84-99df-11e0-9789-60eb69729418', '828476805', 'Archaic Mace');
INSERT INTO `textinfo` VALUES ('e06f7f2a-99df-11e0-9789-60eb69729418', '859070857', 'A Paladin is a defensive warrior specializing in the use of shields to deflect incoming damage and set up powerful counter attacks. In addition they call upon divine powers to bolster their own defenses as well as those of nearby allies.');
INSERT INTO `textinfo` VALUES ('e06f7fd0-99df-11e0-9789-60eb69729418', '873863968', 'Bard');
INSERT INTO `textinfo` VALUES ('e06f80e0-99df-11e0-9789-60eb69729418', '903519873', 'The Paragon is an offensive fighter who does not pause long enough to give his enemy time to attack him. A master of dual-wielding blades, he builds up powerful attacks using parries and disciplined forms to both propel his attacks and keep him out of danger.');
INSERT INTO `textinfo` VALUES ('e06f82c0-99df-11e0-9789-60eb69729418', '960698118', 'Bronze Chain Boots');
INSERT INTO `textinfo` VALUES ('e06f83ad-99df-11e0-9789-60eb69729418', '973230057', 'Hair 0');
INSERT INTO `textinfo` VALUES ('e06f849a-99df-11e0-9789-60eb69729418', '977209993', 'Pyromancers are offensive mages whose sole focus is the mastery of fire. They are capable of harnessing this power for a multitude of uses, from massively destructive fireballs to more subtle manipulations that trap their opponents behind a blazing wall of fire.');
INSERT INTO `textinfo` VALUES ('e06f8587-99df-11e0-9789-60eb69729418', '977822520', 'Assassin');
INSERT INTO `textinfo` VALUES ('e06f8f96-99df-11e0-9789-60eb69729418', '986420103', 'Paragon');
INSERT INTO `textinfo` VALUES ('e06f9089-99df-11e0-9789-60eb69729418', '1024865159', 'The Sentinel is a healer who brings the blessings of light and healing to all that would do the will of the gods. Capable of healing large groups of those in need, Sentinels bolster their allies with the life of the gods, and protect themselves with the wrath of the divine.');
INSERT INTO `textinfo` VALUES ('e06f9164-99df-11e0-9789-60eb69729418', '1041077407', 'Hair 0');
INSERT INTO `textinfo` VALUES ('e06f924b-99df-11e0-9789-60eb69729418', '1064222948', 'Archaic Battle Axe');
INSERT INTO `textinfo` VALUES ('e06f932c-99df-11e0-9789-60eb69729418', '1094808779', 'Hair 0');
INSERT INTO `textinfo` VALUES ('e06f940d-99df-11e0-9789-60eb69729418', '1112368934', 'Warlord');
INSERT INTO `textinfo` VALUES ('e06f94ee-99df-11e0-9789-60eb69729418', '1147721173', 'Elementalist');
