INSERT INTO `textinfo` VALUES ('e06f96b0-99df-11e0-9789-60eb69729418', '1161411888', 'Reavers are defensive specialists who combine the art of combat with the entropic energies of death. The slightest touch of their weapon can spread disease and incite madness, leaving enemies incapable of mounting an assault against the Reaver and their allies.');
