INSERT INTO `textinfo` VALUES ('e06fffbe-99df-11e0-9789-60eb69729418', '1835952263', 'The Riftstalker is a defensive specialist who has learned to bend the magic of the planes to aid them in battle. They use this knowledge to shift themselves in and out of the planes granting them unprecedented mobility and the ability to shrug off the most lethal of blows.');
INSERT INTO `textinfo` VALUES ('e070012d-99df-11e0-9789-60eb69729418', '1851555127', 'A Riftblade is an offensive Warrior who uses both blade and elemental forces to attack his enemies. Versatile in their attacks they are able to attack at range with spears of elemental energy or in close combat by enhancing their weapon with raw elemental power. ');
INSERT INTO `textinfo` VALUES ('e070029c-99df-11e0-9789-60eb69729418', '1852658812', 'Cabalists');
