INSERT INTO `textinfo` VALUES ('e0700dd4-99df-11e0-9789-60eb69729418', '2039982942', 'Marksmen are offensive sharpshooters who are trained to thin the enemy ranks with ruthless efficiency. They combine swift hit and run attacks with devastating volleys, endlessly harassing their opponents, leaving behind a field of dead and crippled foes in their wake.');
INSERT INTO `textinfo` VALUES ('e0700f43-99df-11e0-9789-60eb69729418', '2047247274', 'Paladin');
INSERT INTO `textinfo` VALUES ('e07010b2-99df-11e0-9789-60eb69729418', '2080082465', 'The Beastmaster is an offensive warrior whose strength comes from a deep bond with his spirit companion. This companion both manifests as an ally in battle and also emboldens the Beastmaster, granting its virtues to its master.');
INSERT INTO `textinfo` VALUES ('e0701221-99df-11e0-9789-60eb69729418', '2086564935', 'Inquisitors are offensive clerics who specialize in the ministering of pain. They channel their divine wrath into individuals they deem worthy of punishment, corrupting the blood in their veins and slowing the beat of their very hearts. ');
INSERT INTO `textinfo` VALUES ('e0701396-99df-11e0-9789-60eb69729418', '2093385868', 'Archaic Sword');
INSERT INTO `textinfo` VALUES ('e070150b-99df-11e0-9789-60eb69729418', '2098326075', 'Bards are support specialists who use their songs to inspire their allies and dishearten their foes, and are most effective as part of a group of adventurers, where their musical codas, fanfares, and anthems are most effective. ');
INSERT INTO `textinfo` VALUES ('e0701680-99df-11e0-9789-60eb69729418', '2138559873', 'The Chloromancer is a healing specialist who draws on the vital energies of plants and nature to find a balance between life and death. This allows them to harness energies into a devastating force, or recycle destructive magic to heal their allies.');
